import "./ExpenseItem.css";

function ExpenseItem() {
	return (
		<div>
			<div>Sep 15 2021</div>

			<div>
				<h2>Gasto de auto</h2>
				<div>$40.000</div>
			</div>
		</div>
	);
}

export default ExpenseItem;
